import React from 'react'

import classes from './AuthForm.module.css'

const Banner = () => (
    <div className = { classes.Banner }>
        <h1>supercubicle</h1>
        <p>Hempen halter wench hornswaggle hail-shot nipper boom yo-ho-ho topmast gangplank parley. Barkadeer belay salmagundi provost mizzen pillage Shiver me timbers black jack scuppers fire in the hole. Yawl mizzenmast cable landlubber or just lubber run a shot across the bow ballast grog blossom man-of-war grapple overhaul.</p>
    </div>
)

const AuthForm = () => {
    return (
        <div className = { classes.AuthFormContainer }>
            <Banner />
        </div>
    )
}

export default AuthForm
